import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import useFetch from "../../hooks/useFetch.js";
import "../Tela.css"


const Form2 = () => {

    return <>
                    <h2>Escolha seus interesses</h2>
                    <Form.Group className="mb-2">
                    <Form.Label htmlFor="genero">Quais s√£o os seus interesses?</Form.Label>
                    <MDBCheckbox name='flexCheck' value='' id='flexCheckDefault' label='Default checkbox' />
                    <MDBCheckbox name='flexCheck' value='' id='flexCheckChecked' label='Checked checkbox' defaultChecked />
                    </Form.Group>

                    <br/>
                    <Button variant="primary" type="submit" className="px-5 mb-3 mt-3">
                    Enviar
                    </Button>   
    </>
}

export default Form2;
